import {Component} from "react";
import './style.css'

class Navbar extends Component {
    render() {
        return (
            <nav>
                <link href="https://github.com/MAA28">
                    GitHub
                </link>
                <link href="/404">
                    Blogs
                </link>
                <link href="https://www.instagram.com/malteaschenbach/">
                    Instagram
                </link>
            </nav>
        );
    }
}

export default Navbar;
